import React from "react";
import styled from "styled-components";


const CompletedDiv = styled.li`
text-decoration: ${props => props.completed ? "line-through" : ""};
`;

const Track = ({ track, handleToggle }) => {

  const handleClick = (e) => {
    e.preventDefault()
    handleToggle(e.currentTarget.id)
  }
  return (
    <CompletedDiv completed={track.complete}>
      <div id={track.number} name="track" key={track.number + track.title} onClick={handleClick} className={track.complete ? "todo strike" : "todo"}>
        {track.title}
      </div>
    </CompletedDiv >
  );
};

export default Track;
